  "efficacy": "1. 성인에서 말초와 중추 신경병증성 통증의 치료\n2. 간질\n성인에서 이차적 전신증상을 동반하거나 동반하지 않은 부분발작의 보조제\n3. 섬유근육통의 치료",
  "uses": "이 약은 프레가발린으로서 1일 총 투여용량을 1일 2회로 나누어 음식물과 상관없이 경구 투여한다. 이 약은 주로 신장으로 배설되므로, 신기능이 저하된 환자에 대해서는 용량이 조절되어야 한다. (‘5. 신기능 장애환자’항 참고)\n1. 신경병증성 통증\n1) 말초 신경병증성 통증\n성인: 이 약은 시작용량으로 1일 150 mg을 투여할 수 있다. 개개 환자에서의 반응과 내약성에 근거하여 3일 내지 7일 후에 1일 300 mg까지 증량할 수 있다. 필요하다면, 이후 7일 간격으로 1일 최대 600 mg까지 증량할 수 있다.\n2) 중추 신경병증성 통증\n성인: 이 약은 시작용량으로 1일 150 mg을 투여할 수 있다. 개개 환자에서의 반응과 내약성에 근거하여 1주일 후에 1일 300 mg까지 증량할 수 있다. 추가로 1주일 후에 목표 1일 용량인 600 mg까지 증량할 수 있다. 목표 1일 용량에서 내약성을 나타내지 않을 경우 용량 감소가 고려될 수 있다. (‘4. 투여의 중단’항 참고)\n2. 간질\n성인: 이 약은 시작용량으로 1일 150 mg을 투여할 수 있다. 개개 환자에서의 반응과 내약성에 근거하여 일주일 후에 1일 300 mg까지 증량할 수 있다. 필요하다면, 이 후 7일 간격으로 1일 최대 600 mg까지 증량할 수 있다.\n3. 섬유근육통\n섬유근육통에 대한 이 약의 권장 용량은 1일 300 mg ~ 450 mg 이다. 이 약은 시작 용량으로 75 mg 씩 1일 2회 (1일 150 mg)를 투여하며, 유효성과 내약성에 근거하여 1주일 이내에 150 mg 씩 1일 2회 (1일 300 mg) 까지 증량할 수 있다. 1일 300 mg의 용량에서 충분한 유익성을 경험하지 못한 환자의 경우에는 1주일 이내에 225 mg 씩 1일 2회 (1일 450 mg) 까지 증량할 수 있다. 1일 600 mg의 용량에서도 임상 연구가 실시되었으나, 이 용량에서의 부가적인 유익성이나 충분한 내약성에 대한 증거는 없다. 용량 의존적인 이상반응을 고려하면, 1일 450 mg을 초과하는 용량 투여는 권장되지 않는다.\n4. 투여의 중단\n현재의 임상적 경험에 따르면, 이 약의 투여를 중단할 경우, 적어도 1주일 이상의 간격을 두고 점진적으로 중단하여야 한다.\n5. 신기능 장애환자\n이 약은 전신순환을 거친 후 미변화체의 형태로 주로 신장으로 배설된다. 이 약의 클리어런스는 크레아티닌 클리어런스에 직접적인 영향을 받으므로 신기능이 저하된 환자에서의 용량감소는 크레아티닌 클리어런스에 근거하여 개별화되어야 한다. 크레아티닌 클리어런스[표1]는 아래의 공식에 의해 결정된다.\n이 약은 혈액투석에 의해 혈장에서 효과적으로 제거된다. (4시간 이내에 50%정도). 혈액투석을 하는 환자에서 프레가발린의 1일 투여용량은 신기능에 근거하여 조정되어야 한다. 신기능에 따른 1일 투여용량 외에 매 4시간 마다 혈액투석을 실시한 후에는 추가로 보충 용량을 즉시 투여하여야 한다.\n[표1]. 신기능에 근거한 프레가발린의 용량 적용\n크레아티닌 클리어런스\n(CLcr), (mL/min)\n프레가발린의 1일 총 투여량 a\n투여방법\n시작용량\n(mg/일)\n최대용량\n(mg/일)\n≥60\n150\n600\nBID or TID\n≥30 -＜60\n75\n300\nBID or TID\n≥15 -＜30\n25-50\n150\nQD or BID\n＜15\n25\n75\nQD\n혈액투석 이후의 용량 추가\n  25\n100\n단회용량 b\nTID = 1일 총 투여량을 3회로 나누어 투여\nBID = 1일 총 투여량을 2회로 나누어 투여\nQD = 1일 1회 투여\na: 1일 총 투여용량 (mg/일)은 투여방법에 명시된 바와 같이 나누어서 투여하여야 한다.\nb: 추가 용량은 단회로 추가 투여되는 용량을 말한다.\n6. 간기능 장애환자\n간기능 장애환자에서의 용량조정은 필요치 않다.\n7. 소아 및 청소년 환자\n만 12세 미만의 소아와 만 12 ~17세의 청소년 환자에 대하여 안전성 및 유효성 자료가 충분하지 않으므로, 투여는 권장되지 않는다.\n8. 고령자 (만 65세 이상)\n신기능이 저하된 고령자의 경우에는, 용량 감소가 필요할 수도 있다.",
  "precaution": "1. 경고\n1) 자살충동과 자살행동\n(1) 항간질약을 복용한 환자에서 자살충동 또는 자살행동을 보이는 위험성이 증가되므로 항간질약을 치료받은 환자는 자살충동 또는 자살행동, 우울증의 발현 또는 악화 및 기분과 행동의 비정상적 변화에 대하여 모니터링되어야 한다.\n(2) 항간질약을 처방받는 간질과 다른 많은 질병은 그 자체가 이환 및 사망, 치료기간 동안의 자살충동과 자살행동의 위험성증가와 관련된다. 따라서 처방자는 항간질약 처방시 환자의 치료기간 동안 자살충동 또는 자살행동과 치료될 질병간의 연관성 유무 및 이 약의 유효성을 함께 고려한다.\n2. 다음 환자에는 투여하지 말 것\n1) 프레가발린 또는 이 약의 성분에 과민한 환자\n3. 다음 환자에는 신중히 투여할 것\n1) 당뇨환자: 최근 프레가발린의 투여로 체중이 증가된 당뇨환자는 혈당강하제의 용량 조정이 필요할 수 있다.\n2) 혈관부종을 포함한 과민반응이 시판 후 경험에서 보고된 바 있다. 안면, 입주위 및 상기도 부종과 같은 혈관부종의 증상이 나타난 경우에는 즉시 프레가발린을 중단해야 한다.\n3) 고령자: 프레가발린의 투여는 고령의 환자에서 우연한 상해의 빈도를 증가시킬 수 있는 어지러움 및 졸음과 연관되었다. 시판 후 조사에서 의식 소실, 혼돈, 정신 장애가 보고된 바 있다. 따라서 이 약의 잠재적인 효과에 익숙해질 때까지 주의하도록 환자에게 주지 시켜야 한다.\n4) 시판 후 경험에서, 프레가발린을 투여한 환자에서 일시적 시야흐림과 시력의 다른 변화가 보고되었다. 프레가발린의 중단으로 이러한 증상이 사라지거나 개선될 수 있다.\n5) 프레가발린을 보조제로서 투여하여 발작을 조절한 후 프레가발린을 단독요법으로 투여하기 위해 병용중인 항간질약을 중단한 경험에 대한 자료는 충분치 않다.\n6) 프레가발린을 단기간 또는 장기간 치료하다 중단한 후에, 일부 환자에서 불면증, 두통, 구역, 불안, 설사, 인플루엔자유사증후군, 안절부절, 우울, 통증, 발작, 다한증 및 어지러움과 같은 금단 증상이 관찰되었다.\n7) 프레가발린은 약물 남용과 관련된 수용체에 작용한다고 알려져 있지 않다. 하지만 시판후 자료에서 오용 및 남용 사례들이 보고되었다. 다른 모든 CNS 활성 약물과 마찬가지로, 환자들의 약물 남용 병력을 주의 깊게 검토하고 그들의 프레가발린 오용 및 남용 징후(예, 내성의 발전, 투여용량 증량, 약물추구 행위)를 관찰해야 한다.\n8) 신기능 장애에 대한 약물 중단의 효과가 체계적으로 연구된 바는 없으나, 프레가발린의 중단이나 용량 감소 후에 신기능이 개선되었다는 보고가 있었다.\n9) 프레가발린 노출과 울혈성 심부전 사이에 인과 관계가 확인된 바는 없으나, 시판후 조사에서 프레가발린을 투여한 일부 환자의 울혈성심부전이 보고된 바 있다. 임상적으로 유의한 심장 또는 말초혈관 질환이 없는 환자에 대한 단기 시험에 의하면, 고혈압이나 울혈성심부전 같은 심혈관계 합병증과 말초성 부종 사이에 명백한 관련이 나타나지 않았다. 중증의 울혈성심부전 환자에 대한 자료가 충분치 않으므로 이러한 환자들에게는 신중히 투여해야 한다.\n10) 이 약과 아편유사 진통제를 병용투여 시, 중추신경계 억제 위험성이 있으므로 주의한다. 아편유사 진통제 사용자군에 대한 관찰연구에서, 이 약과 아편유사 진통제를 병용투여하는 환자들이 아편유사 진통제 단독투여시 보다 아편유사 진통제 관련 사망의 위험이 더 높았다 (보정된 오즈비 (aOR): 1.68, 95%신뢰구간: 1.19-2.36).\n11) 이 약 사용과 관련하여 중증 호흡 억제가 보고되었다. 호흡 기능 저하, 호흡기 또는 신경계 질환, 신장 장애 및 고령자는 이러한 중증 이상 반응을 경험할 위험이 더 높을 수 있다. 이러한 환자에게는 용량 조정이 필요할 수 있다.\n4. 이상반응\n1) 이 약의 임상프로그램에서는 12,000명 이상의 환자들에게 약물이 투여되었으며, 이 중 7,000명 이상의 환자들은 이중맹검, 위약대조 임상시험에 참여한 환자들이었다. 가장 흔하게 보고된 이상반응은 어지러움 및 졸음이었고, 이상반응은 대체로 경증에서 중등도로 나타났다. 모든 대조임상시험에서 이상반응으로 인한 투여의 중단은 프레가발린을 투여한 환자의 14%, 위약을 투여한 환자의 5%에서 나타났다. 투여의 중단을 가져온 가장 흔한 이상반응은 어지러움 및 졸음이었다. 임상 시험들의 통합 분석 (pooled analysis)에서 약물 관련으로 선택된 이상반응을 아래의 표에 기관계(SOC) 및 빈도에 따라 기재하였다. 이런 용어들의 빈도는 임상시험자료 중 모든 인과관계가 있는 이상반응에 기초하였다.\n-매우 흔하게: ≥1/10\n-흔하게: ≥1/100, <1/10\n-흔하지 않게: ≥1/1000, <1/100\n-드물게: <1/1000\n아래의 표에 기재된 이상반응은 기저질환 및/혹은 병용약물과 연관되어 나타날 수도 있다.\n[표 2] 임상시험 경험에서의 이상반응\n기관계(SOC)\n이상반응\n감염\n흔하게\n코인두염\n혈액 및 림프계\n흔하지 않게\n중성구감소증\n대사 및 영양\n흔하게\n식욕증가\n흔하지 않게\n식욕부진, 저혈당\n정신계\n흔하게\n혼돈, 방향감장애, 자극과민성, 우울, 다행감, 성욕감소, 불면증\n흔하지 않게\n이인증, 성감이상증, 안절부절, 초조, 기분동요, 감정저하, 감정상승, 적절한 용어 찾기의 어려움, 환각, 비정상적인 꿈, 성욕증가\n드물게\n공황발작, 억제불능, 무감동\n신경계\n매우 흔하게\n어지러움, 졸음\n흔하게\n실조, 운동협조이상, 평형장애, 기억상실, 주의력 장애, 기억력 장애, 떨림, 구음장애, 감각이상, 감각저하, 진정, 졸음증\n흔하지 않게\n인지력장애, 안구진탕, 언어장애, 간대성근경련, 반사저하, 운동이상, 정신운동성 과민, 체위성어지러움, 지각과민, 작열감, 활동떨림, 실신\n드물게\n혼미, 운동저하증, 후각이상, 미각소실, 필기장애\n눈\n흔하게\n시야흐림, 복시\n흔하지 않게\n간접시 상실(주변시력상실), 시야장애, 시야결손, 광시증, 안구건조, 안구종창, 시력감소, 안구통증, 눈피로, 눈물분비증가, 안구자극\n드물게\n산동, 진동시, 시야의 심도인지 변화, 사시, 시야 밝음(brightness)\n귀 및 미로\n흔하게\n현훈\n흔하지 않게\n청각과민증\n심장계\n흔하지 않게\n1도 방실차단, 빈맥, 동성서맥\n드물게\n동성빈맥, 동성부정맥\n혈관계\n흔하지 않게\n저혈압, 고혈압, 홍조, 안면홍조, 말초 냉증\n호흡기계\n흔하지 않게\n호흡곤란, 비출혈, 기침, 비울혈, 비염, 코골이\n드물게\n인후긴장, 비강건조\n알수 없음 호흡 억제\n소화기계\n흔하게\n구토, 복부팽만, 변비, 구강건조, 고창(방귀)\n흔하지 않게\n타액분비과다, 역류성식도염, 구강감각 저하\n드물게\n복수, 연하곤란, 췌장염\n피부 및 피하조직\n흔하지 않게\n발한, 구진상 발진, 두드러기\n드물게\n식은땀\n근골격계 및 결합조직\n흔하게\n근육경련, 관절통, 등통증, 사지통증, 자궁경부경련\n흔하지 않게\n관절종창, 근육통, 근육연축, 목의 통증, 근육경직\n드물게\n횡문근융해\n신장 및 비뇨기계\n흔하지 않게\n배뇨장애, 요실금\n드물게\n요감소, 신부전\n생식계 및 유방\n흔하지 않게\n발기부전, 사정지연, 성기능장애, 월경통\n드물게\n무월경, 유방통, 유방분비물, 유방비대\n전신이상 및 투여 부위\n흔하게\n말초부종, 부종, 보행이상, 넘어짐, 취한느낌, 느낌이상, 피로\n흔하지 않게\n흉부조임감, 전신부종, 통증, 발열, 오한, 무력, 갈증\n검사\n흔하게\n체중증가\n흔하지 않게\n알라닌 아미노트란스페라제(ALT) 증가, 혈중 크레아틴 포스포키나제 증가, 아스파테이트 아미노트란스페라제(AST) 증가, 혈당 증가, 혈소판 수치 감소, 혈중 칼륨 감소, 체중감소\n드물게\n혈중 크레아티닌 증가, 백혈구 수치 감소\n2) 시판 후 조사에서 나타난 이상반응\n(1) 국외 시판 후 경험\n- 면역계: 흔하지 않게: 과민성, 드물게: 혈관부종, 알레르기 반응\n- 신경계: 매우 흔하게: 두통, 흔하지 않게: 의식 소실, 정신 장애\n- 눈: 드물게: 각막염\n- 심장: 드물게: 울혈성 심부전\n- 호흡기계: 드물게: 폐부종\n- 소화기계: 흔하게: 구역, 설사, 드물게: 혀부종\n- 피부 및 피하조직: 흔하지 않게: 안면 부종, 가려움\n- 신장 및 비뇨기계: 드물게: 요저류\n- 생식계 및 유방: 드물게: 여성형 유방증\n- 전신이상 및 투여부위: 흔하지 않게: 권태\n빈도불명의 쇼크, 아나필락시스 유사 증상, 피부점막안증후군(스티븐스-존스 증후군), 다형홍반이 나타날 수 있으므로 잘 관찰하고, 이상이 확인되는 경우에는 투여를 중지하고 적절한 조치를 취한다.\n(2) 국내 시판 후 조사 결과\n국내에서 재심사를 위하여 6년 동안 3,926명을 대상으로 실시한 사용성적조사 결과 인과관계에 상관없이 유해사례 발현율은 4.96%(195명/3,926명, 262건)로 보고되었고, 이 중 이 약과 인과관계를 배제할 수 없는 약물유해반응 발현율은 4.30%(169명/3,926명, 226건)이었다. 졸음이 1.73%(68명/3,926명, 68건)로 가장 많았고, 어지러움 1.71%(67명/3,926명, 67건), 구강건조 0.53%(21명/3,926명, 21건), 부종 0.31%(12명/3,926명, 12건), 현훈 0.18%(7명/3,926명, 7건), 구토, 말초부종이 각각 0.13%(5명/3,926명, 5건), 떨림, 경련악화가 각각 0.10%(4명/3,926명, 4건)순으로 나타났으며 그 밖에 0.1% 미만으로 보고된 약물유해반응을 기관별로 분류하면 다음과 같다.\n- 전신: 피로, 무력, 보행이상\n- 정신계: 성욕감소, 수면장애, 불면증\n- 신경계: 운동실조, 구어장애, 감각이상, 기억력장애, 주의력 장애\n- 소화기계: 변비, 위장장애, 혈변\n- 신장 및 비뇨기계: BUN증가, 요실금, 배뇨곤란\n- 생식계 유방: 발기부전\n- 대사 및 영양: 저혈당, 식욕증가\n- 눈: 복시, 시야흐림\n- 귀 및 부속기관: 귀울림\n- 피부 및 피하조직: 안면부종, 피부질환\n- 검사: 혈중크레아티닌증가, 체중증가\n이 중 시판 전 임상시험에서 나타나지 않았던 예상하지 못한 약물유해반응은 경련악화 0.10%(4명/3,926명, 4건), 위장장애, 귀울림, 수면장애, 피부질환, BUN증가, 혈변이 각각 0.03%(1명/3,926명, 1건)으로 보고되었다.\n중대한 유해사례가 인과관계와 상관없이 2명에서 3건(대장암종, 위장염, 폐렴) 보고되었다.\n신장애 환자에서 유해사례 발현율이 15.71%(11명/70명, 14건)로 높게 보고되었고, 이 중 이 약과 인과관계를 배제할 수 없는 약물유해반응은 10.00% (7명/70명, 10건)로 관찰되었다.\n3) 항간질약을 치료받은 환자는 자살충동 또는 자살행동, 우울증의 발현 또는 악화 및 기분과 행동의 비정상적 변화를 보인다. 11종의 다른 항간질약을 사용하여 199개의 위약-대조 임상 시험(단독요법과 부가요법)을 분석한 결과 항간질약 복용환자는 위약 투여환자와 비교 시 약 2배의 자살충동 또는 자살행동의 위험을 보였다. 12주의 치료기간 동안 자살행동 또는 자살충동 발생율은 27,864명의 항간질약 치료환자에서 0.43%였으며 16,029명의 위약 투여 환자에서는 0.24%였다. 이는 치료받은 530명 환자 중 한 명은 자살 충동 또는 자살 행동을 보인 것을 의미한다. 동 약물 치료 환자에서 4건의 자살이 있었고 위약 치료 환자에서의 자살은 없었다. 그러나, 자살 예수가 너무 적어 이 약과 자살의 연관성을 결론지을 수는 없다. 항간질약 복용에 의한 자살충동 또는 자살행동의 위험증가는 약물치료 시작 초기 1주에 관찰되었고 치료기간 동안 지속되었다. 대부분의 임상시험은 24주 이상을 초과할 수 없었으며 24주를 초과한 자살충동 또는 자살행동의 위험은 평가할 수 없었다. 자살충동 또는 자살행동 위험은 분석된 11종의 항간질약에서 일관적이었다. 다양한 작용기전과 사용범위를 가진 항간질약에서의 위험성 증가는 어떤 효능으로든 사용된 모든 항간질약에 대해서도 위험성이 있음을 나타낸다. 그 위험성은 분석된 임상시험에서 연령(5-100세)에 따라 차이가 나지는 않았다.\n4) 국내 자발적 이상사례 보고자료(1989-2014년)를 분석한 결과, 이상사례가 보고된 다른 의약품에서 발생한 이상사례에 비해 통계적으로 유의하게 많이 보고된 이상사례는 다음과 같이 나타났다. 다만, 이로서 곧 해당성분과 다음의 이상사례 간에 인과관계가 입증된 것을 의미하는 것은 아니다.\n- 정신계: 섬망\n5) 국내 시판 후 이상사례 보고자료(1989-2015년 6월)를 토대로 실마리정보 분석·평가 결과 새로 확인된 이상사례는 다음과 같다. 다만, 이로서 곧 해당성분과 다음의 이상사례 간에 인과관계가 입증된 것을 의미하는 것은 아니다.\n- 신경계: 마비(얼굴마비)\n5. 일반적 주의\n1) 환자 및 보호자에게 항간질약이 우울증의 징후 및 증상의 발현 또는 악화, 비정상적 기분과 행동의 변화, 자살충동 및 자살행동 또는 자해충동의 위험을 증가시킬 수 있음을 알려 환자에게 이러한 증상 또는 행동이 발현될 경우 즉시 의료전문가에게 보고될 수 있도록 한다.\n2) 이 약의 유효성은 당뇨병성 말초 신경병증 및 대상 포진후 신경통 환자를 대상으로 한 임상시험에서 입증되었다. 다른 신경병증성 통증에 대한 유효성은 평가되지 않았다.\n3) 운전 및 기계 사용에의 영향: 이 약은 어지러움 및 졸음을 유발할 수 있다. 환자들은 이 약이 환자들의 이런 활동에 영향을 주는지에 대해 알기 전까지는 이 약을 복용하는 동안 운전 및 복잡한 기계의 조작 혹은 잠재적인 위험성이 있는 활동을 하지 않도록 권고되어야 한다.\n6. 상호작용\n1) 프레가발린은 인체에서 거의 대사되지 않으며, 주로 미변화체로 뇨로 배설된다(2%미만의 용량만이 대사체로 뇨에서 재흡수 됨). in vitro에서 약물의 대사를 저해하지 않으며, 혈장 단백질에 결합하지 않아 약동학적 상호작용을 유발하지 않고, 또한 이에 영향을 받지 않는 것으로 보인다.\n2) 따라서, in vivo시험에서 프레가발린과 페니토인, 카바마제핀, 발프론산, 라모트리진, 가바펜틴, 로라제팜, 옥시코돈, 에탄올 사이에는 임상적으로 연관성 있는 약동학적 상호작용이 관찰되지 않았다. 모집단에 대한 약동학적 분석에서 경구용 혈당강하제, 이뇨제, 인슐린, 페노바르비탈, 티아가빈 및 토피라메이트는 프레가발린의 클리어런스에 임상적으로 유의적인 영향을 주지 않는 것으로 나타났다.\n3) 프레가발린과 노르에치스테론 및/혹은 에치닐 에스트라디올과 같은 경구피임제의 병용투여는 상호간의 항정 상태의 약동학에 영향을 미치지 않았다.\n4) 대조 임상시험에서, 프레가발린과 옥시코돈, 로라제팜, 에탄올의 다회 병용투여는 호흡에 임상적으로 중요한 영향을 미치지 않았다. 프레가발린은 옥시코돈으로 인해 발생한 인지력 및 운동기능의 감소에 영향을 미친다. 프레가발린은 에탄올 및 로라제팜의 효과를 증강시킬 수 있다.\n5) 시판 후 조사에서, 약물남용 환자를 포함하여 프레가발린과 다른 중추신경계 억제제를 복용한 환자에서 호흡부전, 혼수 및 사망이 보고된 바 있다.\n6) 시판 후 조사에서, 아편유사 진통제와 같은 변비 유발 성분의 약물과 병용투여 시, 하부소화기계 기능 감소 (예를 들어, 장폐쇄증, 무력 장폐쇄증, 변비)와 관련된 사례가 보고된 바 있다.\n7) 고령의 지원자에서 약력학적 상호작용에 대한 연구는 행하여지지 않았다.\n7. 임부 및 수유부에 대한 투여\n1) 임부: 임부를 대상으로 프레가발린을 투여한 적절한 자료는 없다. 동물을 대상으로 한 시험에서 생식독성이 나타났으나, 인체에서의 잠재적인 위험성은 밝혀지지 않았다. 따라서, 이 약은 치료상의 유익성이 태아에 대한 위험성을 상회하는 경우를 제외하고는 임부에 투여하지 않는다. 가임여성에 투여시 효과적인 피임법을 실시해야 한다.\n2) 수유부: 프레가발린은 수유부의 모유 중으로 이행된다. 영아에 대한 프레가발린의 안전성은 밝혀진바 없으므로 프레가발린을 투여하는 동안 수유는 권장되지 않는다. 영아에 대한 모유수유의 유익성과 산모에 대한 치료의 유익성을 고려하여 모유수유를 중단할지 또는 프레가발린 투여를 중단할지 결정해야 한다.\n8. 고령자에 대한 투여 (만 65세 이상)\n고령자에서 연령 증가에 따라 프레가발린의 클리어런스는 감소하는 경향이 있다. 프레가발린의 경구 클리어런스의 감소는 고령에 따른 크레아티닌 클리어런스의 감소와 연관된다. 연령 증가에 따라 신기능이 저하된 환자에서 이 약의 용량조정이 필요할 수 있다.\n9. 과량투여시의 처치\n시판 후 조사에서, 프레가발린의 과량투여시 관찰된 가장 흔한 이상반응은 정동장애, 졸림, 혼돈 상태, 우울증, 동요, 안절부절이었다. 발작도 보고되었다. 프레가발린을 과량 투여 시, 일반적인 보조요법(supportive measures) 및 필요하다면 혈액투석이 필요하다.\n10. 보관 및 취급상의 주의사항\n1) 어린이의 손이 닿지 않는 곳에 보관한다.\n2) 다른 용기에 바꾸어 넣는 것은 사고원인이 되거나 품질 유지 면에서 바람직하지 않으므로 이를 주의한다.\n11. 기타\n1) 전임상 안전성 자료\n(1) 동물에 대한 약리학적 안전성시험결과 프레가발린은 임상적으로 연관된 용량에서 내약성이 양호한 것으로 나타났다. 랫드 및 원숭이에 대해 실시한 반복투여 독성시험에서 활동감소, 활동증가 및 운동실조와 같은 중추신경계에 대한 영향이 관찰되었다. 임상 최고 추천 용량에서의 인체 평균 노출의 5배 이상에 해당되는 용량에 장기간 노출된 고령의 albino 랫드에서 망막위축 빈도의 증가가 관찰되었다.\n(2) 프레가발린은 마우스, 랫드, 혹은 토끼에서 태자독성을 유발하지 않았다. 랫드 및 토끼에서의 태자독성은 인체 투여용량보다 상당히 높은 고용량에 노출된 경우에만 나타났다. 출생 전후에 대한 독성시험에서, 프레가발린은 인체 최고 추천용량의 2배 이상의 용량에 노출시킨 랫드의 태자에서 발달독성을 나타내었다.\n(3) 프레가발린은 in vitro 및 in vivo 시험의 결과로 볼 때 유전독성을 나타내지 않았다.\n(4) 프레가발린은 랫드 및 마우스를 대상으로 2년 발암성 시험을 실시하였다. 인체 추천 최고용량인 1일 600mg에서의 평균 인체 노출과 비교하여 24배의 노출에 해당하는 용량에 노출된 랫드에서 종양은 관찰되지 않았다. 또한, 평균 인체 노출용량과 비슷한 용량에 노출된 마우스에서 종양빈도의 증가는 관찰되지 않았다. 그러나 고용량의 노출에서 혈관육종 빈도의 증가가 관찰되었다. 마우스에서 프레가발린으로 유도된 종양형성의 기전은 혈소판 변화 및 내피세포증식과 연관된 비유전적인 기전이었다. 단기간 및 제한된 장기간의 임상자료를 근거로 랫드 및 인체에서는 혈소판 변화가 나타나지 않았다. 따라서, 이것과 연관된 인체에서의 위험성의 증거는 없다.\n(5) 어린 (Juvenile) 랫드에서 나타난 독성의 종류는 성인 랫드에서 관찰된 것과 질적으로 다르지 않았으나, 태자 랫드에서 좀 더 예민하였다. 치료용량의 노출에서, 활동증가, 이갈이 및 성장에 대한 약간의 변화(일시적인 체중증가 억제)등의 중추신경계 임상증후의 증거가 있었다. 발정주기에 대한 효과는 인체 치료노출의 5배에서 관찰되었다. 인체 치료 노출의 2배 이상의 용량에 1-2주 동안(청각 놀람 반응)/5주 동안(학습/기억) 노출된 랫드의 태자에서 신경행동/인지에 대한 영향이 관찰되었다. 인체치료노출의 2배 이상의 용량으로 1-2주 동안 노출된 어린 랫드에서 청각놀람반응의 감소가 나타났다. 9주 동안 노출한 후에는 이러한 효과가 더 이상 관찰되지 않았다.",
